import React from "react";

function Skills() {
  const skills = [
    "React.js",
    "Node.js",
    "Python",
    "Java",
    "C++",
    "HTML/CSS",
    "Tailwind CSS",
    "Linux",
  ];

  return (
    <div className="skills">
      <h1>Skills</h1>
      <ul>
        {skills.map((skill, index) => (
          <li key={index}>{skill}</li>
        ))}
      </ul>
    </div>
  );
}

export default Skills;
